import React from 'react';
import {
  SiJava, SiCsharp, SiKotlin, SiHtml5, SiCss3, SiJavascript, SiPhp,
  SiSpringboot, SiDotnet, SiBlazor, SiAngular, SiBootstrap, SiXampp,
  SiMysql, SiMicrosoftsqlserver, SiMongodb,
  SiGit, SiGithub, SiDocker, SiFirebase, SiIntellijidea, SiVisualstudiocode, SiVisualstudio, SiAndroidstudio,
} from 'react-icons/si';

export default function Technologies() {
  const sections = [
    {
      title: "üíª Lenguajes de programaci√≥n",
      items: [
        { name: "Java", icon: <SiJava /> },
        { name: "C#", icon: <SiCsharp /> },
        { name: "Kotlin", icon: <SiKotlin /> },
        { name: "HTML5", icon: <SiHtml5 /> },
        { name: "CSS3", icon: <SiCss3 /> },
        { name: "JavaScript", icon: <SiJavascript /> },
        { name: "PHP", icon: <SiPhp /> },
      ],
    },
    {
      title: "‚öôÔ∏è Frameworks y entornos",
      items: [
        { name: "Spring Boot", icon: <SiSpringboot /> },
        { name: ".NET 8", icon: <SiDotnet /> },
        { name: "Blazor", icon: <SiBlazor /> },
        { name: "Angular", icon: <SiAngular /> },
        { name: "Bootstrap", icon: <SiBootstrap /> },
        { name: "XAMPP", icon: <SiXampp /> },
      ],
    },
    {
      title: "üõ¢Ô∏è Bases de datos",
      items: [
        { name: "MySQL", icon: <SiMysql /> },
        { name: "SQL Server", icon: <SiMicrosoftsqlserver /> },
        { name: "MongoDB", icon: <SiMongodb /> },
      ],
    },
    {
      title: "üß∞ Herramientas",
      items: [
        { name: "Git", icon: <SiGit /> },
        { name: "GitHub", icon: <SiGithub /> },
        { name: "Docker", icon: <SiDocker /> },
        { name: "Firebase", icon: <SiFirebase /> },
        { name: "IntelliJ IDEA", icon: <SiIntellijidea /> },
        { name: "Visual Studio Code", icon: <SiVisualstudiocode /> },
        { name: "Visual Studio", icon: <SiVisualstudio /> },
        { name: "Android Studio", icon: <SiAndroidstudio /> },
      ],
    },
  ];

  return (
    <section id="technologies" className="py-12 bg-neutral-900 text-white px-4">
      <div className="max-w-5xl mx-auto grid grid-cols-1 md:grid-cols-2 gap-8">
        {sections.map((sec) => (
          <div key={sec.title} className="bg-neutral-800 rounded-lg p-6">
            <h3 className="text-xl font-semibold mb-4">{sec.title}</h3>
            <div className="grid grid-cols-2 gap-4">
              {sec.items.map((tech) => (
                <div
                  key={tech.name}
                  className="flex items-center gap-3 bg-neutral-700 p-3 rounded transition hover:bg-neutral-600"
                >
                  <span className="text-2xl">{tech.icon}</span>
                  <span className="text-sm">{tech.name}</span>
                </div>
              ))}
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}
